pragma solidity ^0.5.0;
import "./Ref.sol";
interface IERC20 {
    function totalSupply() external view returns (uint256);
    function balanceOf(address account) external view returns (uint256);
    function transfer(address recipient, uint256 amount) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
    function approve(address spender, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
}
pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;
contract Piswapnew{
    address public owner;
    constructor() public {owner = msg.sender;}
    bool hasOpentransfer;
    uint public balancepool3day = 14114400000000;
    uint public balancepool15day = 22800000000000;
    uint public balancepool30day = 28228800000000;
    uint public timeendpool = 1606153354;//time end: 30/12/2020 1609372742
    uint public openpool = 1606152154; //time start: 1/12/2020 1606780800
    uint public time3day = 300; // 259200
    uint public time15day = 600; //1296000
    uint public time30day = 900; //2592000
    uint public ratiopool3day = balancepool3day / ((timeendpool - openpool)/60);
    uint public ratiopool15day = balancepool15day / ((timeendpool - openpool)/60);
    uint public ratiopool30day = balancepool30day / ((timeendpool - openpool)/60);
    IERC20 public LQPIS = IERC20(0x31ffE9A7859D12C335570DB37B7FDF198CfbE185); //Ropsten Liquylity pool PIS
    IERC20 public PIS = IERC20(0x77483F98845affD4b7c8E6d73a01E33a74Bbe4E7); //Ropsten Liquylity pool PIS
    mapping(address => uint) public totalstake;
    mapping(address => bool) public user;
    struct Liststake{
         string stakeID;
         address staker;
         uint amount;
         uint ratio;
         uint timewithdraw;
         uint choice; 
         uint reward70;
         uint reward30;
         bool withdrawstatus;
         uint constamount;
    } 
    // struct Listshowstake{
    //     address staker;
    //     uint amount;
    //     uint timewithdraw;
    //     uint choice;
    // }
    struct ListCollection{
        address staker;
        uint balance;
        uint timecollect;
    }
     Liststake[] public liststake;
    //  Listshowstake[] public listshowstake;
     ListCollection[] public listCollection;
     uint public totalpool3day = 0;
     uint public totalpool15day = 0;
     uint public totalpool30day = 0;
     bool public hasPool3day;
     bool public hasPool15day; 
     bool public hasPool30day; 
     uint public lasttimeStake3day = openpool;
     uint public lasttimeStake15day = openpool;
     uint public lasttimeStake30day = openpool;

     function stake(string memory stakeID, uint amount, uint choice, address contractref,address sponsor) public {
        Ref ref= Ref(contractref);
        require(amount > 0, "amount cannot be 0");
        require(timeendpool > block.timestamp, "The pool is closed");
        require(choice == 1 || choice == 2 || choice == 3, "Choice not exist");
        user[msg.sender]=true;
        bool hasContract;
        LQPIS.transferFrom(msg.sender, address(this), amount);
        uint timewithdraw =0;
        uint lasttimeStake =0;
        uint balancepoolstake=0;
        uint ratio =0;
        address sponsorref;

        // if(ref.getHasrefuse(sponsor)){sponsorref =  sponsor;}else{sponsorref = owner;}
        // ref.setsponsor(msg.sender,sponsorref);
        // ref.sales(msg.sender, amount);

        uint time=0;
        if(block.timestamp > openpool){time = block.timestamp;}else{time = openpool;}
        if(choice ==1){
            hasContract = hasPool3day;
            timewithdraw = time + time3day;
            totalpool3day +=amount;
            balancepoolstake =totalpool3day;
            lasttimeStake = lasttimeStake3day;
            ratio=ratiopool3day;
        }else if(choice ==2){
            hasContract = hasPool15day;
            timewithdraw = time + time15day;
            totalpool15day +=amount;
            balancepoolstake =totalpool15day;
            lasttimeStake = lasttimeStake15day;
            ratio=ratiopool15day;
        }else if(choice ==3){
            hasContract = hasPool30day;
            timewithdraw = time + time30day;
            totalpool30day +=amount;
            balancepoolstake =totalpool30day;
            lasttimeStake = lasttimeStake30day;
            ratio=ratiopool30day;
            totalstake[msg.sender] +=amount;
            // if(totalstake[msg.sender] > 365000000 && !ref.getHasrefuse(msg.sender)){
            //     ref.createref(msg.sender);  
            // }
        }  
        if(timewithdraw > timeendpool){timewithdraw = timeendpool;}    
        if(!hasContract){ 
           liststake.push(Liststake(stakeID, msg.sender, amount, ratio, timewithdraw, choice, 0, 0, false, amount));
           hasContract = true;
        }else{
            for(uint i =0; i<liststake.length; i++){ 
                if(liststake[i].choice == choice && liststake[i].timewithdraw > lasttimeStake){
                    uint timecal = 0;
                    if(liststake[i].timewithdraw > time){timecal = time;}else{timecal=liststake[i].timewithdraw;}
                    liststake[i].reward70 += 7 * liststake[i].ratio * (timecal - lasttimeStake)/600 ;
                    liststake[i].reward30 += 3 * liststake[i].ratio * (timecal - lasttimeStake)/600 ;
                    liststake[i].ratio = ratio * liststake[i].amount / balancepoolstake;
                    // ref.caculationInterest(liststake[i].staker, liststake[i].ratio * (timecal - lasttimeStake)/60) ;
                }                     
            }
            liststake.push(Liststake(stakeID, msg.sender, amount, ratio * amount/balancepoolstake, timewithdraw, choice, 0, 0, false, amount)) ;
        }
        if(choice ==1){
            hasPool3day = hasContract;
            lasttimeStake3day= time;
        }else if(choice ==2){
            hasPool15day = hasContract;
            lasttimeStake15day= time;
        }else if(choice ==3){
            hasPool30day = hasContract;
            lasttimeStake30day= time;
        }
     }

     function collection(address contractref) public{
         Ref ref= Ref(contractref);
         require(openpool < block.timestamp, "The pool is not open yet");
         require(user[msg.sender],"You can't collect");
         uint blcollection =0;
         uint time;
         if(block.timestamp > timeendpool){time = timeendpool;}else{time=block.timestamp;}
         for(uint i =0; i< liststake.length;i++){
             uint lasttime =0;
            if(liststake[i].choice ==1){
                lasttime = lasttimeStake3day;
            }else if(liststake[i].choice ==2){
                lasttime = lasttimeStake15day;
            }else if(liststake[i].choice ==3){
                lasttime = lasttimeStake30day;
            }
            if(liststake[i].timewithdraw > lasttime){
                uint timecal = 0;
                if(liststake[i].timewithdraw > time){timecal = time;}else{timecal=liststake[i].timewithdraw;}
                liststake[i].reward70 += 7 * liststake[i].ratio * (timecal - lasttime)/600 ;              
                liststake[i].reward30 += 3 * liststake[i].ratio * (timecal - lasttime)/600 ;
                // ref.caculationInterest(liststake[i].staker, liststake[i].ratio * (timecal - lasttime)/60) ;
            }
            if(liststake[i].staker==msg.sender){
                blcollection += liststake[i].reward70;
                liststake[i].reward70 =0;
            }
         }
         lasttimeStake3day = lasttimeStake15day = lasttimeStake30day = time;
         require(blcollection > 0,"You can't collect");
         uint balanceref = ref.getBalancewithdraw(msg.sender);               
         PIS.transfer(msg.sender,(blcollection+balanceref));
         ref.resetBalance(msg.sender);
        listCollection.push(ListCollection(msg.sender, (blcollection + balanceref), block.timestamp));
     }

     function withdraw(address contractref, string memory stakeID, uint choice) public{
          Ref ref= Ref(contractref);
         require(openpool < block.timestamp, "The pool is not open yet");
         uint balancewith = 0;
         uint time;
         if(block.timestamp > timeendpool){time = timeendpool;}else{time=block.timestamp;}
         for(uint i=0; i< liststake.length; i++){
             if(keccak256(bytes(liststake[i].stakeID)) == keccak256(bytes(stakeID)) && liststake[i].choice == choice && liststake[i].staker == msg.sender && liststake[i].timewithdraw < block.timestamp && liststake[i].withdrawstatus == false){
                 balancewith = liststake[i].amount;
                 liststake[i].amount =0;
                 liststake[i].withdrawstatus = true;
             }
         }
         require(balancewith>0,"Insufficient balance");
         LQPIS.transfer(msg.sender,balancewith);
         uint lasttimewi =0;
         uint ratiowi =0;
         uint totalpool=0;
         if(choice ==1){
             lasttimewi = lasttimeStake3day;
             ratiowi = ratiopool3day;
             totalpool= totalpool3day-balancewith;
         }else if(choice ==2){
             lasttimewi = lasttimeStake15day;
             ratiowi = ratiopool15day;
             totalpool= totalpool15day-balancewith;
         }else if(choice ==3){
             lasttimewi = lasttimeStake30day;
             ratiowi = ratiopool30day;
             totalpool= totalpool30day-balancewith;
         }
         for(uint i=0; i< liststake.length; i++){
                if(liststake[i].choice == choice && liststake[i].timewithdraw >= lasttimewi){
                    uint timecal = 0;
                    if(liststake[i].timewithdraw > time){timecal = time;}else{timecal=liststake[i].timewithdraw;}
                    liststake[i].reward70 += 7 * liststake[i].ratio * (timecal - lasttimewi)/600 ;
                    liststake[i].reward30 += 3 * liststake[i].ratio * (timecal - lasttimewi)/600 ;
                    // ref.caculationInterest(liststake[i].staker, liststake[i].ratio * (timecal - lasttimewi)/60) ;
                    if(totalpool ==0){
                        liststake[i].ratio =0;
                    }else{
                        liststake[i].ratio = ratiowi * liststake[i].amount / totalpool;
                    }
                    if(liststake[i].staker == msg.sender){liststake[i].ratio =0;}                
                }    
         }
         if(choice ==1){
             lasttimeStake3day = time;
             totalpool3day = totalpool;
         }else if(choice ==2){
             lasttimeStake15day = time;
             totalpool15day = totalpool;
         }else if(choice ==3){
             lasttimeStake30day = time;
             totalpool30day = totalpool;
         }
     }
     function withdraw30(string memory stakeID, address contractref) public{
        //  withdrawl all in account
        require(hasOpentransfer, "Plase wait open DAO");
        for(uint i =0; i<liststake.length; i++){ 
            if(keccak256(bytes(liststake[i].stakeID)) == keccak256(bytes(stakeID)) && liststake[i].staker == msg.sender){  
                 Ref ref= Ref(contractref);
                 uint balanceref = ref.getBalancewithdraw30(msg.sender);               
                PIS.transfer(msg.sender,(liststake[i].reward30 + balanceref));
                ref.resetBalance30(msg.sender);
                liststake[i].reward30 =0;
            }
        }
     }

     function openWithdraw() public{
         require(msg.sender == owner, "You can't open withdraw");
         hasOpentransfer = true;
     }
     function getListstake() public view returns(Liststake[] memory){
        return liststake;
     }
     function getListCollection() public view returns(ListCollection[] memory){
        return listCollection;
     }
     function withdrawOwner(uint amount) public{
         require(msg.sender == owner, "You can't withdraw");
         PIS.transfer(msg.sender,amount);
     }
     function withdrawOwnerlp(uint amount) public{
         require(msg.sender == owner, "You can't withdraw");
         LQPIS.transfer(msg.sender,amount);
     }
}
